import React from "react";
import { NavLink } from "react-router-dom";

function Header() {
  return (
    <nav className="header">
      <NavLink exact activeClassName="active" to="/">
        Home
      </NavLink>
      <NavLink activeClassName="active" to="/appimg">
        Partitura
      </NavLink>
      <NavLink activeClassName="active" to="/appnames">
        Nomes
      </NavLink>
      <NavLink activeClassName="active" to="/appsymbols">
        Letras
      </NavLink>
    </nav>
  );
}
export default Header;
